Release Date Sep 05, 2012
Starring: Veronica Avluv, Adrianna Luna, BiBi Jones, Laura Crystal
After doing time for a heist gone wrong, the beautiful BiBi Jones gets a shot at redemption. Ahll she has to do is hold out in a Halfway House full of lustful women. But when her past comes back to haunt her, she has to fight her old instincts or give in to temptation!
